export const getComprasMiMorton = async (req, res) => {

    try{
        res.setHeader('Access-Control-Allow-Origin', '*');
        res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE');
        res.setHeader('Access-Control-Allow-Headers', '*');
        console.log("************************************");
        console.log("getComprasMiMorton");
       //const pool = await getConnection();
        const pool = await getConnection();


        var sqlQuery = "SELECT TOP 400 buyrbllg.bidder," +
                            "inventor.invno as invno, " +
                            "inventor.itemstatus lastinfo, "+
                            "martillo = CASE WHEN inventor.hammer IS NOT NULL THEN inventor.hammer ELSE buyrbllg.hammer END, " +
                            "inventor.high, inventor.low,inventor.receipt, buyrbllg.saleno, buyrbllg.custno, buyrbllg.premtax, saledate.salename," +
                            "saledate.salelocale, FORMAT (saledate.saledate, 'd MMMM yyyy | hh:mm tt', 'es-mx') as saledate, saledate.saledate, " +
                            "FORMAT (saledate.saledate, 'd', 'es-mx') as dateshort," +
                            "buyrbllg.date, buyrbllg.premium, buyrbllg.premtax AS IVA, buyrbllg.trnstype, buyrbllg.crdbmemo, inventor.descript, inventor.lot, inventor.refno, "+
                            "buyrbllg.hammer as martillo_total, buyrbllg.premium as premium_total, buyrbllg.debit, buyrbllg.credit," +
                            "estate = CASE WHEN invpaid = 'P' THEN 'Pagado' ELSE 'Por pagar' END, " +
                            "buyrbllg.taxrate, inventor.rcptdescr, SUBSTRING (ISNULL(pictures.pictpath, ''), 4, LEN(ISNULL(pictures.pictpath, ''))) as pictpath " +
                        "FROM buyrbllg " +
                            "INNER JOIN inventor ON buyrbllg.invno = inventor.invno " +
                            "LEFT JOIN saledate ON buyrbllg.saleno = saledate.saleno " +
                            "LEFT JOIN pictures ON inventor.refno = pictures.refno " +
                        "WHERE buyrbllg.custno = '"+ req.params.no_cliente+"' "+
                            "AND buyrbllg.invno IN (SELECT invno FROM buyrbllg WHERE custno = '"+ req.params.no_cliente+"' AND trnstype = 'Recibo' AND invno IS NOT NULL) " +
                            " AND (pictures.pictname IS NULL OR pictures.pictname IN (SELECT TOP 1 pictname FROM pictures WHERE refno = inventor.refno)) " +
                            "AND buyrbllg.trnstype = 'Recibo' " +
                        "ORDER BY buyrbllg.date DESC;" ;


        const result = await pool.request().query(sqlQuery);
        console.log("OK-getComprasMiMorton" + sqlQuery);
        res.json(result.recordset);
    
    }catch{
        console.log("ERROR getDetail");
        console.log(sqlQuery);
    }
}

export const getContratosMiMorton = async (req,res) =>{
    try{
        res.setHeader('Access-Control-Allow-Origin', '*');
        res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE');
        res.setHeader('Access-Control-Allow-Headers', '*');
        console.log("************************************");
        console.log("getContratosMimMorton");
        const pool = await getConnection();

        var sqlQuery = "SELECT TOP (300) inventor.receipt, inventor.item, inventor.lot, inventor.edate, inventor.custno, inventor.descript, inventor.refno reference, inventor.itemstatus actualStatus, saledate.salename, saledate.saledate, saledate.salelocale, historia.newName, historia.newSaleno, historia.fecha, inventor.saleno, condition = CASE WHEN inventor.itemstatus = 'EAC' THEN CONCAT ('','Vendido') ELSE CONCAT('','No vendido') END  FROM inventor  FULL OUTER JOIN saledate ON inventor.saleno = saledate.saleno LEFT JOIN (SELECT MAX(itemhist.saleno) newSaleno, itemhist.refno, MAX(saledate.salename) newName, MAX(saledate.saledate) fecha FROM itemhist JOIN inventor ON inventor.refno = itemhist.refno JOIN saledate ON saledate.saleno = itemhist.saleno WHERE itemhist.event LIKE '%Added%' GROUP BY itemhist.refno) AS historia ON inventor.refno = historia.refno WHERE inventor.custno= '"+req.params.no_cliente+"'  ORDER BY saledate.saledate DESC, inventor.edate DESC, inventor.receipt";

        const result = await pool.request().query(sqlQuery);
        console.log("OK-getContratosMimOrton" + sqlQuery);
        res.json(result.recordset);
    }catch{
        console.log("ERROR getDetail");
        console.log(sqlQuery);
        res.json(result.recordset);
    }
}

export const getVentasMiMorton = async (req,res) => {
    try{
        res.setHeader('Access-Control-Allow-Origin', '*');
        res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE');
        res.setHeader('Access-Control-Allow-Headers', '*');
        console.log("************************************");
        console.log("getVentasMiMorton Original");
        const pool = await getConnection();


        var sqlQuery = "SELECT "+
        "DISTINCT TOP 400 (RIGHT(salelot,7)) as lot,"+
        "salelot ,"+
        "results.refno, "+
        "saledate.saleno,"+
        "cnsgbllg.trnstype,"+
        "results.price as martillo,"+
        "estatus = CASE WHEN results.price > 0 THEN 'Vendido' WHEN results.price=0 THEN 'No Vendido' END,"+
        "saledate.salename, "+
        "saledate.saledate, "+
        "FORMAT (saledate.saledate, 'd MMMM yyyy | hh:mm tt', 'es-mx') as fchVenta,"+
        "saledate.salelocale,"+
        "SUBSTRING (pictures.pictpath,4,LEN(pictpath)) as pictpath,"+
        "inventor.receipt as invno,"+
        "inventor.descript, "+
        "inventor.rcptdescr,"+
        "inventor.high, "+
        "inventor.low "+
        "FROM results "+
        "FULL OUTER JOIN inventor ON inventor.refno= results.refno "+
        "INNER JOIN cnsgbllg ON results.custno = cnsgbllg.custno "+
        "INNER JOIN saledate ON LEFT(results.salelot,7) = saledate.saleno "+
        "INNER JOIN pictures ON results.refno = pictures.refno "+
        "where results.custno = '"+ req.params.no_cliente+"' "+ "AND cnsgbllg.custno = '"+ req.params.no_cliente+"' AND cnsgbllg.trnstype='Liquidación'  "+
        "AND LEFT(results.salelot,7) IN (SELECT DISTINCT(substring(salercpt,1,7)) FROM cnsgbllg where custno = '"+ req.params.no_cliente+"' )"+
        "AND  pictures.pictname in (select  top 1  pictname from pictures where refno = inventor.refno) "+
        "AND trnstype='Liquidación' AND results.price>0 ORDER  BY saledate.saledate DESC ";
        //const result = await pool.request().query(sqlQuery);
        console.log(sqlQuery);
        const result = await pool.request().query(sqlQuery);
        res.json(result.recordset);

    }catch{
        console.log("ERROR getVentas Original");
        console.log(sqlQuery);
        res.json(result.recordset);
    }
}

