export const getCardBank = async(req,res) => {
    
    try {

        res.setHeader('Access-Control-Allow-Origin', '*');
        res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE');
        res.setHeader('Access-Control-Allow-Headers', '*');
        const response = await axios.get(`https://lookup.binlist.net/`+req.params.card, {
            headers: { 'Accept': 'application/json',
            'Access-Control-Allow-Origin':'*',
            'Access-Control-Allow-Methods':'GET, POST, PUT, DELETE',
            'Access-Control-Allow-Headers':'*'}
        });

        // Devolver la información del banco si la API responde correctamente
        if (response.data && response.data.bank) {
            return res.json({
                banco: response.data.bank.name || 'Desconocido',
                marca: response.data.scheme || 'Desconocida',
                tipo: response.data.type || 'Desconocido'
            });
        } else {
            return res.status(404).json({ message: 'No se encontró información para este BIN.' });
        }
        } catch (error) {
            return res.status(500).json({ message: 'Error al obtener la información del banco.' });
        }
}

